void L1_Data_Gen::thread_hdltv_gen() {
    const char* dump_tv = std::getenv("AP_WRITE_TV");
    if (!(dump_tv && string(dump_tv) == "on")) return;

    wait();

    mHdltvinHandle << "[ " << endl;
    mHdltvoutHandle << "[ " << endl;
    int ap_cycleNo = 0;
    while (1) {
        wait();
        const char* mComma = ap_cycleNo == 0 ? " " : ", " ;
        mHdltvinHandle << mComma << "{"  <<  " \"ap_rst_n\" :  \"" << ap_rst_n.read() << "\" ";
        mHdltvoutHandle << mComma << "{"  <<  " \"L1_data_out_V_TDATA\" :  \"" << L1_data_out_V_TDATA.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"L1_data_out_V_TVALID\" :  \"" << L1_data_out_V_TVALID.read() << "\" ";
        mHdltvinHandle << " , " <<  " \"L1_data_out_V_TREADY\" :  \"" << L1_data_out_V_TREADY.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"l1datagen_stateout_V\" :  \"" << l1datagen_stateout_V.read() << "\" ";
        mHdltvoutHandle << " , " <<  " \"CDATA_COUNTER_V\" :  \"" << CDATA_COUNTER_V.read() << "\" ";
        mHdltvinHandle << "}" << std::endl;
        mHdltvoutHandle << "}" << std::endl;
        ap_cycleNo++;
    }
}

